import { createStore } from 'vuex'

export default createStore({
  state: {
    isAuth: false,
    openedAuth: false
  },
  getters: {
    getAuth(state) {
      return state.isAuth
    },
    getOpenedAuth(state) {
      return state.openedAuth
    }
  },
  mutations: {
  },
  actions: {
  },
  modules: {
  }
})
